# You are preparing for an exam in Calculus 4. In the chapter "Abstract
# Fourier Series", you encountered an excercise in which you are given a
# collection of N statements and your task is to prove that all N
# statements are equivalent. For the purpose of this problem, we will
# number the statements 0 through N-1.

# For any pair of statements x and y, you are able to prove that statement
# x implies statement y. However, the proofs of different implications may
# have different difficulties. You are given a int[] D with N^2 elements.
# For each x and y, the difficulty of proving the implication "x => y" is
# D[x*N+y].

# The exercise is solved by proving a set of implications such that each
# statement directly or indirectly implies each other statement. For
# example, if N = 3, one way of solving the exercise is to prove the
# implications 0 => 1, 1 => 0, 0 => 2, and 2 => 0. Another way of solving
# the exercise is to prove the implications 0 => 1, 1 => 2, and 2 => 0.

# You are not looking for the least difficult solution. When writing
# proofs, your biggest issue is switching between easy and hard proofs.
# Therefore, you are looking for a solution where the difference between
# the difficulty of the hardest proof and the difficulty of the easiest
# proof is as small as possible. Compute and return that difference.
from collections import deque


class HardProof(object):
    # O(n^4log(n))
    def minimumCost(self, D):
        # If the N statements are nodes on a graph we need a path that
        # visits all the nodes and starts and ends at the same node.
        # (Hamilton cycle) minimizing the range of difficulties used.
        difficulties = sorted(list(set(D)))
        best = float("inf")
        for i, m in enumerate(difficulties):
            M = find_M(D, difficulties, i)
            best = min(best, M - m)
        return best


def find_M(D, difficulties, i):
    # Finds the best possible max difficulty given a minimum difficulty of
    # m = difficulties[i] using binary search.
    m = difficulties[i]
    p, r = i, len(difficulties) - 1
    if not is_possible(D, m, difficulties[r]):
        return float("inf")
    while p < r:
        q = (p + r) / 2
        if is_possible(D, m, difficulties[q]):
            r = q
        else:
            p = q + 1
    return difficulties[p]


def is_possible(D, m, M):
    # Returns True if statements are equivalent using only proofs of difficulty
    # between m and M.
    N = int(len(D) ** (1.0 / 2))
    # BFS from statement 0 to see if statement 0 implies all other statements.
    seen = set([0])
    Q = deque([0])
    while Q:
        x = Q.popleft()
        for y in xrange(N):
            if y not in seen and m <= D[x * N + y] <= M:
                seen.add(y)
                Q.append(y)
    if len(seen) < N:
        return False
    # Repeat to see if all other statements imply statement 0.
    seen = set([0])
    Q = deque([0])
    while Q:
        x = Q.popleft()
        for y in xrange(N):
            if y not in seen and m <= D[y * N + x] <= M:
                seen.add(y)
                Q.append(y)
    if len(seen) < N:
        return False
    return True


